const A="Microbiology Chapter 20 Homework",f="Homework questions for Microbiology Chapter 20.",I="Microbiology",g=[{id:"mc-ch20-hw-1",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 20",topic:"Immunological Assays",difficulty:"easy",question:"An ELISA test is used to determine if a certain autoantibody is present in a serum sample.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:0,explanation:"True. ELISA (Enzyme-Linked Immunosorbent Assay) is a common laboratory technique used to detect the presence of an antibody or an antigen in a sample."},{id:"mc-ch20-hw-2",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 20",topic:"Immunological Assays",difficulty:"easy",question:"The agents in a test do not need to be refrigerated.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:1,explanation:"False. Most biological reagents, including antibodies and enzymes used in ELISA kits, are sensitive to temperature and must be stored under specific refrigerated conditions to maintain their activity."},{id:"mc-ch20-hw-3",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 20",topic:"Immunological Assays",difficulty:"easy",question:"Sample dilutions do not need to be freshly prepared due to the nature of the ELISA test.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:1,explanation:"False. For accurate and reliable results, it is standard laboratory practice to prepare sample dilutions freshly just before use in an ELISA."},{id:"mc-ch20-hw-4",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 20",topic:"Immunological Assays",difficulty:"easy",question:"All reagents and samples should be pipetted to the bottom of the wells.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:0,explanation:"True. Pipetting reagents and samples to the bottom of the wells helps prevent splashing and cross-contamination between wells, ensuring the accuracy of the assay."},{id:"mc-ch20-hw-5",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 20",topic:"Immunological Assays",difficulty:"medium",question:"With this graph, the concentration antibodies in the unknown serum cannot be determined.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:1,explanation:"False. This graph is a standard curve. By measuring the absorbance of the unknown sample and finding that value on the y-axis, you can extrapolate to the x-axis to determine the concentration of antibodies in the serum."}],v={name:A,description:f,subject:I,questions:g};export{v as default,f as description,A as name,g as questions,I as subject};
